import React from "react";
import "bootstrap/dist/css//bootstrap.min.css";
import { Button, Navbar, Container } from "react-bootstrap";
import { useSelector, useDispatch } from "react-redux";
import { deleteUser } from "../store/states/user";
import { useNavigate } from "react-router";
import axios from "axios";
import { Link } from "react-router-dom";

const Nav = () => {
  const dispatch = useDispatch();
  const navigate = useNavigate();
  const user = useSelector((state) => state.user);
  const logoutHandler = () => {
    axios
      .post("/api/users/logout")
      .then((res) => {
        dispatch(deleteUser(res.data));
        return res.data;
      })
      .then(() => navigate("/"));
  };
  return (
    <Navbar bg="dark" variant="dark" className="navbar navbar-expand-lg navbar-light bg-light">
      <Container>
          <Navbar.Brand href="#home">
            <img
              src="data:image/png;base64,"
              width="30"
              height="30"
              className="d-inline-block align-top"
              alt="React Bootstrap logo"
            />
          </Navbar.Brand>
        </Container>
      <a className="navbar-brand" href="/">
        Bienvenidos a CUEVANA2777
      </a>
      {user.email ? (
        <>
          <Link to="/favorites">
            <Button className="navbar-brand">
              favorites
            </Button>
          </Link>
          <Link to="/">
            <Button onClick={logoutHandler} className="navbar-brand">
              logout
            </Button>
          </Link>
          <Link to="/users">

              Users

          </Link>
        </>
      ) : (
        <>
          <Link to="/register">
            <Button className="navbar-brand" href="/register">
              register
            </Button>
          </Link>
          <Link to="/login">
            <Button className="navbar-brand">login</Button>
          </Link>
        </>
      )}
    </Navbar>
  );
};

export default Nav;
